cy.get(_support_pageObjects_selectors_json__WEBPACK_IMPORTED_MODULE_0__.radioOption3).click().should('be.checked');

// Working with Alerts
const name = 'Saurav';
const expectedAlertMsg = `Hello ${name}, share this practice page and share your knowledge`;
const expectedConfirmMsg = 'Hello , Are you sure you want to confirm?';
// Handle Alert
cy.get(_support_pageObjects_selectors_json__WEBPACK_IMPORTED_MODULE_0__.nameInput).type(name);
cy.get(_support_pageObjects_selectors_json__WEBPACK_IMPORTED_MODULE_0__.alertBtn).click();
cy.on('window:alert', (msg) => {
    expect(msg).to.equal(expectedAlertMsg);
    return true; // Click OK
});
// Handle Confirm - Accept (OK)
cy.get(_support_pageObjects_selectors_json__WEBPACK_IMPORTED_MODULE_0__.confirmBtn).click();
cy.on('window:confirm', (msg) => {
    expect(msg).to.equal(expectedConfirmMsg);
    return true; // Click OK
});
// Handle Confirm - Dismiss (Cancel)
cy.get(_support_pageObjects_selectors_json__WEBPACK_IMPORTED_MODULE_0__.confirmBtn).click();
cy.on('window:confirm', (msg) => {
    expect(msg).to.equal(expectedConfirmMsg);
    return false; // Click Cancel
});

